  margin-bottom: 20px;
  border: 1px soild #d9d9d9;
  padding: 20px;
`;

const NicknameEditForm = (props) => {
  return (
    <FormWrapper>
      <Input.Search addonBefore="닉네임" enterButton="수정" />
    </FormWrapper>
  );
};

export default NicknameEditForm;
